import React from 'react';
import ReactDOM from 'react-dom';

const Hello = (props) => {
  return (
    <div>
      <p>Hello {props.name}, you are a {props.desc}.</p>
    </div>
  )
}

const Meep = () => {
  return (
    <div>
      <h2>This is my MEEP.</h2>
    </div>
  )
}

const App = () => {
  const meep = "MeepMeep"
  const desc = "punk."
  return (
    <div>
      <Meep />
      <h1>MEEP.</h1>
      <Hello name={meep} desc={desc} />
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
